import React, { Component } from 'react';
class Modalbutton extends Component {



    render() {

        return (
            <div className="centered">
<button onClick={() => this.props.buttonHandlerFunction("modal")} type="button" class="btn btn-primary">Primary</button>
        </div>

        )
    }
}
export default Modalbutton;
